          The classic ID bracelet. 
Dorsey ID is a tangible reminder of people or milestones in your life that mean something to you. Engraving can be simple (your mom's name, your daughter’s birthday, or another moment in time you will keep with you forever) or perhaps it’s more veiled (the nickname your brothers gave you growing up or the date you finally decided to take a leap of faith into the unknown). There’s always a story to tell. 
Rendered in 14-carat-gold-coated silver or 14-carat-gold, a paperclip chain means the length can be adjusted to your preferred fit.  We've been known to layer our ID with the Leonora bracelet and the Kate rivière bracelet.
Is this a gift? Here's what to do: engrave later.
Choose an ID and send it back to us at any time for custom engraving — on us. Email VIP@shopdorsey.com.






















                Details



 All Dorsey IDs are final sale  This ID is custom made and ships 13 business days from the date your order is placed   Made in the USA   









                Care


                All Dorsey pieces can be cleaned using warm water and dish soap. Use a soft-bristled toothbrush to gently scrub. Lab diamond and sapphire pieces set in 14K gold can be cleaned using an ultrasonic cleaner. For more detailed information on care and cleaning, visit our Product Knowledge page.









                Shipping and Returns


                Complimentary 2-day shipping.
This made to order style is final sale.














